// Hooks Import
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Switch } from "react-router";
// import { useContext } from "react";

// Pages Import
import Header from "./components/Header";
import Footer from "./components/Footer";

import Home from "./components/pages/home";
import About from "./components/pages/about";
import Contact from "./components/pages/contact";
import Build from "./components/iframes/build";
import Persuade from "./components/iframes/persuade";
import Convert from "./components/iframes/convert";

function App() {
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route exact path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Switch>
            <Route exact path="/Serv" element={<Build />}></Route>
            <Route path="/persuade" element={<Persuade />}></Route>
            <Route path="/convert" element={<Convert />}></Route>
          </Switch>
        </Routes>
        <Footer />
      </Router>
    </>
  );
}

export default App;
